import logo from './logo.svg';
import './App.css';
import Dashboard from './component/Dashboard';
import Navbar  from './component/Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      <div class="row">
      <Navbar/>
      <Dashboard />
      </div>
      </header>
    </div>
  );
}

export default App;
